import React from "react";
import "./App.css";
import AreaCalculatorForm from "./components/AreaCalculatorForm";
import MainComponent from "./components/MainComponent";

function App() {
  return (
    <div className="App">
      <AreaCalculatorForm />
      <MainComponent />
    </div>
  );
}

export default App;
